snippet.textDisplay:
Hello Coke studio, you have unknowingly Missed One Name of Allah out of 99 in the lyrics, and the name is "Al- Ahad".....

It should come like this "Al-Wajid, Al-Majid, Al-Wahid, (" Al-Ahad"), Al-Samad, Al-Qadir,.........

@itsaadee @zulfiqarjkhan

